import React, { Component } from 'react';
import ReportOption from './ReportOption';
import './reports.css';

class Reports extends Component {

  	handleClick(val) {
  	  	alert('hola');
  	}
  	render() {
  	  	return ( 
            <div id="Tbar_Reports" className="report-tbar" data-role="win-tbar" os="windows">
                <ReportOption tab="itemReport0" titulo='Compras' funcionClick={this.props.funcionClick} componente="PurchaseReport" />
                <ReportOption tab="itemReport1" titulo='Compras' funcionClick={this.props.funcionClick} componente="PurchaseReport" />
                <ReportOption tab="itemReport2" titulo='Compras' funcionClick={this.props.funcionClick} componente="PurchaseReport" />               
            </div>	
  	  	);
  	}
}

export default Reports
